import PropTypes from "prop-types";
import { Stage, Layer, Line } from "react-konva";
import { MODE, COLOR_MAP } from "./constants";

const DrawEdit = (props) => {
    return (
        <Stage     
            className="konva-container"
            width={props.width}
            height={props.height}

        >
          <Layer>
            <Text
              x={10}
              y={10}
              text={"Text"}
              fill="#000"
              stroke="#000"
              strokeWidth={1}
            />
          </Layer>
        </Stage>
      );

}

export default DrawEdit;
